import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {BrowserRouter} from "react-router-dom";
import reportWebVitals from './reportWebVitals';

const Application = (
    <BrowserRouter>
        <App/>
    </BrowserRouter>
)

ReactDOM.render(
    <React.StrictMode>
        <Application/>
    </React.StrictMode>,
    document.getElementById('root')
);

reportWebVitals();
